import axios from "axios";
import React from "react";
import { useState } from "react";

const url = "http://localhost:9090/ssd/new";

const AddSsd = () => {


  const [brand, setBrand] = useState("");
  const [model, setModel] = useState("");
  const [serialNumber, setSerialNumber] = useState("");
  const [size, setSize] = useState("");
  const [purchaseDate, setPurchaseDate] = useState("");
  const [purchasePrice, setPurchasePrice] = useState("");
  const [arrivalDate, setArrivalDate] = useState("");
  const [saleValue, setSaleValue] = useState("");

  const [productCategory, setProductCategory] = useState("");
  const [file, setFile] = useState("");

  const handleImage = (e) => {
    console.log(e.target.files);
    setFile(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const myDate = new Date().toLocaleDateString();
    console.log("a-- " + myDate);
    const myInput = document.querySelector("purchaseDate");
    myInput.value = myDate;
    console.log(myDate);

    const myDate2 = new Date().toLocaleDateString();
    console.log(myDate2);
    const myInput2 = document.querySelector("arrivalDate");
    myInput2.value = myDate2;
    console.log(myDate2);

    const ssd = {
      brand,
      model,
      serialNumber,
      size,
      purchaseDate,
      purchasePrice,
      arrivalDate,
      saleValue,
    };
    const category = {
      productCategory,
    };
    console.log(ssd);
    console.log(category);
    const formData = new FormData();
    formData.append("file", file);

    formData.append("brand", brand);
    formData.append("model", model);
    formData.append("serialNumber", serialNumber);
    formData.append("size", size);
    formData.append("purchaseDate", purchaseDate);
    formData.append("purchasePrice", purchasePrice);
    formData.append("arrivalDate", arrivalDate);
    formData.append("saleValue", saleValue);

    formData.append("productCategory", productCategory);
    console.log(file);

    try {
      const response = await axios.post(url, formData, {
        brand: brand,
        model: model,
        serialNumber: serialNumber,
        size: size,
        purchaseDate: myDate,
        purchasePrice: purchasePrice,
        arrivalDate: myDate2,
        saleValue: saleValue,

        productCategory: productCategory,
        // headers:{"Content-Type":"Application/json"},
        // body:JSON.stringify(ssd)
      });

      console.log(response.data);
    } catch (error) {
      console.log(error.response);
    }
  };

  return (
    <div className="meuForm">
      <div className="form-row">
        <form onSubmit={(e) => handleSubmit(e)}>
          <div className="col-md-6 offset-md-3">
            <input type="file" name="file" onChange={handleImage} />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"brand"}
              name="brand"
              value={brand}
              className="form-control"
              placeholder="Marca"
              onChange={(e) => setBrand(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"model"}
              name="model"
              className="form-control"
              value={model}
              placeholder="Modelo"
              onChange={(e) => setModel(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"serialNumber"}
              name="serialNumber"
              className="form-control"
              value={serialNumber}
              placeholder="Nº de série"
              onChange={(e) => setSerialNumber(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"size"}
              name="size"
              className="form-control"
              value={size}
              placeholder="Tamanho"
              onChange={(e) => setSize(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            Data de compra
            <input
              type={"date"}
              name="purchaseDate"
              className="form-control"
              value={purchaseDate}
              placeholder="Data de compra"
              onChange={(e) => setPurchaseDate(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"purchasePrice"}
              name="purchasePrice"
              className="form-control"
              value={purchasePrice}
              placeholder="Preço de compra"
              onChange={(e) => setPurchasePrice(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            Data de venda
            <input
              type={"date"}
              name="arrivalDate"
              className="form-control"
              value={arrivalDate}
              placeholder="Arrival date"
              onChange={(e) => setArrivalDate(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"productCategory"}
              name="productCategory"
              className="form-control"
              value={productCategory}
              placeholder="Categoria do produto"
              onChange={(e) => setProductCategory(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"saleValue"}
              name="saleValue"
              value={saleValue}
              className="form-control"
              placeholder="Valor de venda"
              onChange={(e) => setSaleValue(e.target.value)}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <button
              type="submit"
              className="btn btn-success"
              // onChange={(e) => this.handleSubmit(e)}
            >
              Salvar
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};
export default AddSsd;
